import { Col, Container, Row , Button} from "react-bootstrap";
import "../styles/home.css"
const Home = () => {
    const handleClick = ()=>{
        const menu = document.getElementById("menu")
        
    }
    return (
        <Container >
            <div id="menu" className="d-none card border border-dark d-block d-md-none">
                <ul>
                    <a href="/">Home</a>
                    <a href="/">About</a>
                    <a href="/">Downlaods</a>
                </ul>
            </div>
            <Row>
                <Button onClick={handleClick} variant="primary">button </Button>
            </Row>
        </Container>
    );
}

export default Home;
